    return (
        <Container fluid >
            <Row>
                {/* product Image slider and thumbnails */}
                <Col sm style={{ backgroundColor: "red" }}>
                    <Row className={styles.ImageSliderContainer}>
                        <Col
                            sm={3}
                            className={styles.thumbnailsContainer + " " + "flex-row"}
                            style={{ backgroundColor: "white" }}>
                            {["", "", "", "", ""].map(() => {
                                return (
                                    <div className="my-2" style={{ height: 50, width: 50, backgroundColor: "blue" }}></div>
                                )
                            })}
                        </Col>
                        <Col sm={9}>image slider</Col>
                    </Row>
                </Col>
                {/* Product infod accordion */}
                <Col sm style={{ backgroundColor: "green" }}>
                    Image Slider
                </Col>
            </Row>
        </Container>
    )
}
